import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

var name = "Akshay Pawar";
var image1 = "https://picsum.photos/250/300";
var image2 = "https://picsum.photos/200/300";
var image3 = "https://picsum.photos/270/300";
var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(


    <React.Fragment>
        <h1 style={{color:'blue'}}>Inline Css</h1>
        <div className='img_div'>
            <p>Hello {name}, You should Start Learn</p>
            <img src={image1} alt="Random Images"/>
            <img src={image2} alt="Random Images"/>
            <img src={image3} alt="Random Images"/>
        </div>
    </React.Fragment>

);
